import React from 'react';

const Hero = ({ search, onSearchChange }) => {
  return (
    <div className="hero">
      <img src="https://images.unsplash.com/photo-1624138784614-87fd1b6528f8?q=80&w=2066&auto=format&fit=crop" alt="Sydney Opera House" />
      <div className="overlay">
        <div className="hero-content">
          <h2>Book unique places to stay and things to do.</h2>
          <p>Unforgettable trips start with Airbnb.</p>
          <div className="search-container">
            <input
              type="text"
              placeholder="Search for places"
              value={search}
              onChange={onSearchChange}
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Hero;
